// UserLogin.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import AuthService from '../../services/AuthService';
import { useAuth } from '../../context/AuthContext';

function UserLogin() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const navigate = useNavigate();
  const { login } = useAuth();

  async function loginUser(event) {
      event.preventDefault();
      let userRequest = {
          email: email,
          password: password,
      };

      try {
          AuthService.authenticateUser(userRequest).then((res) => {
              if (res.data.message === "Email not exists") {
                  alert("Email not exists");
              } else if (res.data.message === "Login Success") {
                  alert("Login success");
                  login(res.data.user.user_id, res.data.token, res.data.user);
                  navigate('/user-home');
              } else {
                  alert("Incorrect Email and Password not match");
              }
          });
      } catch (err) {
          alert(err);
      }
  }
    return (
       <div>
            <div className="container">
            <div className="row">
                <h2>Login</h2>
             <hr/>
             </div>

             <div className="row">
             <div className="col-sm-6">

            <form>
        <div className="form-group">
          <label>Email</label>
          <input type="email"  className="form-control" id="email" placeholder="Enter Name"

          value={email}
          onChange={(event) => {
            setEmail(event.target.value);
          }}

          />

        </div>

        <div className="form-group">
            <label>password</label>
            <input type="password"  className="form-control" id="password" placeholder="Enter Fee"

            value={password}
            onChange={(event) => {
              setPassword(event.target.value);
            }}

            />
          </div>
                  <button type="submit" className="btn btn-primary" onClick={loginUser} >Login</button>
              </form>

            </div>
            </div>
            </div>

     </div>
    );
  }

  export default UserLogin;
